import axios from "axios";


export const RegisterPharmacy = () => {
    
    async function getLatLongFromAddress(address: string) {

        const apiKey = 'AIzaSyCvlPTdA0OVBZm-Hy-0DiR_xW41LbGGxfk';
        const geocodingApiUrl = `https://maps.googleapis.com/maps/api/geocode/json?address=1600+Amphitheatre+Parkway,+Mountain+View,+CA&key=${apiKey}`;

        try {
            const response = await axios.get(geocodingApiUrl);
    
            const results = response.data.results;
            if (results.length > 0) {
                const location = results[0].geometry.location;
                console.log(location)
            } else {
                throw new Error('No results found for the provided address.');
        }
      } catch (error) {
            console.error('Error fetching geocoding data:', (error as Error).message);
        throw error;
      }
    }

    getLatLongFromAddress('1600 Amphitheatre Parkway, Mountain View, CA');

    return(
        <div>

        </div>
    );
}
